s16 cal_time_of_sign_change(WORK *wk) {
    if (wk->mvxy.a[1].real.h > 0 && wk->mvxy.d[1].real.h < 0) {
        return wk->mvxy.a[1].sp / -wk->mvxy.d[1].sp;
    }

    return 0;
}

